import React from 'react';
import Movie from './components/Movie';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <div className="container">
      <div><Movie></Movie></div>
    </div>
  );
}

export default App;
